#!/bin/bash

TARFILE="system.tar.gz"
JARFILE="mysql-connector-java-5.1.37-bin.jar"
CURRDIR=$( cd "$( dirname "${BASH_SOURCE[0]}" )" && pwd )

function build {
	
	echo CODEMON INSTALLER
	echo ---------------------
	echo "The program will be unpacked and built into the current directory and then install to a directory of your choice."
	echo -n "Proceed? (y/n): "
	read -n 1 CONFIRM

	if [ ${CONFIRM} == "y" ] || [ ${CONFIRM} == "Y" ]; then
		echo -e "\n\nCreating a temporary file..."
	elif [ ${CONFIRM} == "n" ] || [ ${CONFIRM} == "N" ]; then
		echo -e "\nYou chose not to continue with the default configuration."
		exit
	fi

	uudecode ${0} > /dev/null
	echo Unpacking the tar.gz file...
	tar -xzvf ${TARFILE} > /dev/null
	echo Removing tarball...
	rm ${TARFILE} > /dev/null

	echo
	echo "To continue, your information is needed to connect to the MySQL Database."

	read -p "Enter your central login: " LOGIN

	read -s -p "Enter your password: " PASS
	echo

	echo -e "\nEditing SQL login credentials..."
	sed "s/@@USER@@/${LOGIN}/g" "${CURRDIR}/build/History.java" > ./temp; mv ./temp "${CURRDIR}/build/History.java"
	sed "s/@@PASSWORD@@/${PASS}/g" "${CURRDIR}/build/History.java" > ./temp; mv ./temp "${CURRDIR}/build/History.java"

	echo Creating tables in the database...
	echo javac "${CURRDIR}/build/Create.java" 2> /dev/null
	echo java -cp "${CURRDIR}/build/:${CURRDIR}/build/${JARFILE}" Create 1> /dev/null

	sed  "s|@@SRC@@|${CURRDIR}/Source|" "${CURRDIR}/build/Train.java" > ./temp; mv ./temp "${CURRDIR}/build/Train.java"
	sed  "s|@@CODEMON@@|${CURRDIR}/Codemon|" "${CURRDIR}/build/Train.java" > ./temp; mv ./temp "${CURRDIR}/build/Train.java"
	sed  "s|@@HELPTRAINER@@|${CURRDIR}/Documents/Trainer.txt|" "${CURRDIR}/build/Train.java" > ./temp; mv ./temp "${CURRDIR}/build/Train.java"

	sed  "s|@@SRC@@|${CURRDIR}/Source|" "${CURRDIR}/build/Fight.java" > ./temp; mv ./temp "${CURRDIR}/build/Fight.java"
	sed  "s|@@CODEMON@@|${CURRDIR}/Codemon|" "${CURRDIR}/build/Fight.java" > ./temp; mv ./temp "${CURRDIR}/build/Fight.java"
	sed  "s|@@REPORTS@@|${CURRDIR}/Reports|" "${CURRDIR}/build/Fight.java" > ./temp; mv ./temp "${CURRDIR}/build/Fight.java"
	sed  "s|@@HELPFIGHT@@|${CURRDIR}/Documents/Fight.txt|" "${CURRDIR}/build/Fight.java" > ./temp; mv ./temp "${CURRDIR}/build/Fight.java"

	sed  "s|@@README@@|${CURRDIR}/README.txt|" "${CURRDIR}/build/Codemon.java" > ./temp; mv ./temp "${CURRDIR}/build/Codemon.java"


	echo -e "\nCompilation commencing..."
	cd "${CURRDIR}/build/" && make -f Makefile 1> /dev/null

	if [ $? -ne 0 ]; then
		echo Error with compilation. Build will halt.
		exit
	fi

	echo -e "\nBuild completed."
}

function install {

	echo "Installation Commencing..."
	if [ ! -d "${CURRDIR}/build" ]; then
		echo A build was not completed. Please build before attempting to install.
	exit
	fi

	echo
	echo -n "Enter a directory in which to install the system: "
	read DIRECTORY

	echo -e "\nLocating directory ${DIRECTORY}..."
	if [ -d ${DIRECTORY} ]; then
		if [ -w ${DIRECTORY} ]; then
			echo -e "\nPermission granted to write to ${DIRECTORY}"
		else
			echo -e "\nYou do not have permission to write to ${DIRECTORY}. Installation halt."
			exit
	fi
	else
		echo -n "${DIRECTORY} does not exist, would you like to create it? (y/n): "
		read -n 1 RESP

		if [ ${RESP} == "y" ] || [ ${RESP} == "Y" ]; then
			echo -e "\n\nCreating the directory..."
			mkdir -p ${DIRECTORY}

			if [ $? -ne  0 ]; then
				echo -e "\nCreating the directory ${DIRECTORY} failed. Installation halt."
				exit
			fi

			if [ -w ${DIRECTORY} ]; then
				echo -e "Permission granted to write to ${DIRECTORY}"
			else
				echo -e "\nYou do not have permission to write to ${DIRECTORY}. Installation halt."
				exit
			fi
		else
			echo -e "\n${DIRECTORY} will not be created. Installation will halt."
			exit
		fi
	fi

	echo Creating the bin/ and lib/ and Reports/ Source/ Codemon/ directory...
	mkdir -p ${DIRECTORY}/bin > /dev/null
	mkdir -p ${DIRECTORY}/lib > /dev/null
	mkdir -p ${CURRDIR}/Reports > /dev/null
	mkdir -p ${CURRDIR}/Source > /dev/null
	mkdir -p ${CURRDIR}/Codemon > /dev/null
	mv -f ${CURRDIR}/build/Documents > /dev/null ${CURRDIR}

	echo Installing system onto your computer...

	echo
	echo -n "It is required to edit your .bashrc file. Proceed? (y/n): "
	read -n 1 EDIT

	if [ ${EDIT} == "y" ] || [ ${EDIT} == "Y" ]; then
		echo -e "\nModifying ~/.bashrc..."
		echo "export LD_LIBRARY_PATH=\"${CURRDIR}/${DIRECTORY}/lib/:${LD_LIBRARY_PATH}\"" >> ~/.bashrc
		echo -e "You will have to restart your terminal or source your bashrc to make it work."
	elif [ ${EDIT} == "n" ] || [ ${EDIT} == "N" ]; then
		echo -e "\nNot editing the ~/.bashrc file may result in unexpected behaviour!"
		echo "Installation will continue, but make sure to manually export your LD_LIBRARY_PATH"
	fi

	echo -e "\nCopying files to bin/ and lib/ folders..."
	cp -f "${CURRDIR}/build/"*.class "${DIRECTORY}/bin" 
	cp -f "${CURRDIR}/build/"*.jnilib "${DIRECTORY}/lib"
	cp -f "${CURRDIR}/build/"*.a "${DIRECTORY}/lib"
	cp -f "${CURRDIR}/build/icons/"*.gif "${DIRECTORY}/bin"
	cp -f "${CURRDIR}/build/"*.jar "${DIRECTORY}/bin"
	cp -f "${CURRDIR}/build/"README.txt "${CURRDIR}"

	echo Removing build components...
	rm -rf "${CURRDIR}/build"

	echo -e "\nInstallation finished."
}

if [ "${1}" == "--build" ]; then
	build
elif [ "${1}" == "--install" ]; then
	install
fi

exit 0;

